@LunarKoku *she still looking behind, expecting the father to follow them...her face doesn't even look like the kind one from earlier, her eyes are burning with rage*

Wish, are you ok? Did you get hurt?

* She looks at him and instantly her normal personality is back*

"Hamilton est celui qui décide, qui a les cartes en main, et il en profite." 💪

"Il faut espérer que Sebastian Vettel va retrouver cette joie de vivre et cette rage de vaincre." 🔥

@Julien_FEBREAU a répondu à vos questions dans ce nouvel épisode de #RendezVousAuPremierVirage 🏁 https://t.co/JKjP8XdnIF
